  false,\n\t\"url\": null,\n\t\"notes\": \"As part of a 2006-2007 U.S. Geological
  Survey (USGS) - National Park Service (NPS) Vegetation Mapping Program to create
  a digital database of vegetation for Mesa Verde National Park (MEVE), a mosaic of
  1:12,000-scale true-color DOQQs acquired September 15, 2003 by Horizons Inc., Rapid
  City, SD, was created using ERDAS Imagine Version 9.2 and LizardTech's GeoExpress
  7. Processing was done for the USGS-NPS Vegetation Mapping Program and the NPS Southern
  Colorado Plateau Network by the USGS Fort Collins Science Center's GIS and Remote
  Sensing Team in 2007\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
